    false,nt"url": null,nt"notes": "This narrative report for Sand Lake Migratory
    Waterfowl Refuge outlines Refuge accomplishments from November, 1938 through January,
    1939. The report begins by summarizing the weather conditions during this period.
    Wildlife- including migratory birds, upland game birds, furbearers, predators, rodents,
    raptors, fish, and disease- is also covered. The Refuge development and maintenance
    section discusses physical developments, plantings, and collections and receipts.
    Resource management is outlined; topics include sharecropping. The public relations
    section of the report describes recreational uses, Refuge visitors, and violations.
